PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Projects` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `name` VARCHAR(255), `abbrev` VARCHAR(255), `study_design` VARCHAR(255), `endpoint` VARCHAR(255), `biospecimens` TINYINT(1), `geospatial_data` TINYINT(1), `data_sharing` TINYINT(1), `cancer_endpoint` TEXT, `start_of_follow_up` TEXT, `censoring_rules` TEXT, `questionnarie` TEXT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, project_number INTEGER, version INTEGER default 1, CONSTRAINT project_abbrev_unique UNIQUE (abbrev), CONSTRAINT project_number_unique UNIQUE (project_number));
COMMIT;
